let _markdown = "\n\nWelcome to LinkDen [#welcome-to-linkden]\n\nLinkDen is a self-hosted link-in-bio platform that replaces heavy PHP frameworks with modern TypeScript tooling. Built on the Cloudflare stack, it delivers blazing-fast page loads and full customization through a polished admin panel.\n\nWhat is LinkDen? [#what-is-linkden]\n\nLinkDen gives you a single-user link page at your root URL. Visitors land directly on your links with no registration or multi-user overhead. Behind the scenes, a full admin panel lets you manage every aspect of your page.\n\n**Your links, your brand, your rules.**\n\nKey Highlights [#key-highlights]\n\n* **Edge Performance** -- Static pages served from Cloudflare Pages with API on Workers and D1 SQLite for sub-second load times worldwide.\n* **Full Admin Panel** -- Manage blocks, appearance, analytics, vCard, and Apple Wallet passes from a polished dashboard.\n* **7 Built-in Themes** -- Each theme ships with dark and light variants (14 total) plus auto mode.\n* **5 Block Types** -- Link, Header, Social Icons, Embed, and Contact Form blocks with rich configuration options.\n* **100+ Social Brands** -- Predefined icons for GitHub, Twitter/X, Instagram, YouTube, Discord, and dozens more.\n* **Apple Wallet** -- Generate signed `.pkpass` files for iPhone contact cards.\n* **Whitelabel** -- Toggle off all LinkDen branding with a single setting. MIT license, no attribution required.\n* **Export/Import** -- Back up all data as JSON.\n\nTech Stack [#tech-stack]\n\n| Layer    | Technology                            |\n| -------- | ------------------------------------- |\n| Frontend | Next.js 16, React 19, Tailwind CSS v4 |\n| Backend  | Hono on Cloudflare Workers            |\n| API      | tRPC v11                              |\n| Database | Drizzle ORM + Cloudflare D1 (SQLite)  |\n| Auth     | Better Auth (email/password)          |\n| Styling  | Tailwind CSS + Radix UI               |\n| Monorepo | Turborepo + pnpm workspaces           |\n| Deploy   | Alchemy -> Cloudflare Workers/Pages   |\n\nNext Steps [#next-steps]\n\n* [Quick Start](/docs/getting-started/quick-start) -- Set up your first instance in minutes.\n* [Installation](/docs/getting-started/installation) -- Get LinkDen running locally.\n* [Configuration](/docs/getting-started/configuration) -- Set up authentication and environment variables.\n* [Blocks](/docs/guide/blocks) -- Explore the 5 block types and builder.\n* [Appearance](/docs/guide/appearance) -- Customize themes, colors, and branding.\n";
